console.log('Activating mdbook JS...')

const circuits = {
    sheas_container_rom: '',
    sheas_container_alu: '',
    sheas_container_register: '',
    sheas_container_registerfile: '',
    sheas_container_pc: '',
    sheas_container_1: '',
    sheas_container_2: '',
    sheas_container_3: '',
    sheas_container_4: '',
    sheas_container_fulladder: '',
}

for (circuit_name in circuits) {
    var sheas_container = document.getElementById(circuit_name)
    if (sheas_container!= undefined) {
        console.log('Requesting circuit: ', circuit_name)
        buildSHEAS('embedded', sheas_container, circuits[circuit_name])
    }
}

p2pStart(document.getElementsByClassName("p2p_container"))